import Gugudan from "../games/Gugudan";
import WordChain from "../games/Wordchain";
import ScrollToTop from "../ScrollToTop";

const Main = () => {
  return (
    <React.Fragment>
      <CssBaseline />
      {/* Header */}
      <Bar />
      {/* 새 페이지 들어갈 때 스크롤 맨 위로 */}
      <ScrollToTop />
      {/* Footer */}
      <Footer />
    </React.Fragment>
  );
};

export default Main;
